import React from 'react';
import styled from 'styled-components';
import couple1 from '../images/couple.jpg';
import grossesse1 from '../images/grossesse.jpg';

const data = [
	{
		id: 1,
		picture: couple1,
		category: 'couple'
	},
	{
		id: 2,
		picture: grossesse1,
		category: 'pregnancy'
	}
];

const Galery = () => {
	return (
		<Main>
			<Gallery>
				{data.map((photo, index) => (
					<PicContainer key={index}>
						<Image src={photo.picture} alt={photo.category} />
					</PicContainer>
				))}
			</Gallery>
		</Main>
	)
}

const PicContainer = styled.div`
	height: 200px;
	width: 200px;
`

const Image = styled.img`
	height: 100%;
	border-radius: 4px;
`
const Gallery = styled.div`
	width: 80vw;
	display: flex;
`

const Main = styled.div`
	height: calc(100vh - 80px);
	display: flex;
	justify-content: center;
	align-items: center;
`

export default Galery
